	//GESTURE DETECTOR
	private GestureDetector createGestureDetector(Context context) {
		GestureDetector gestureDetector = new GestureDetector(context);
		// Create a base listener for generic gestures
		gestureDetector.setBaseListener(new GestureDetector.BaseListener() {
			@Override
			public boolean onGesture(Gesture gesture) {
				//6. DONE:
				if (gesture == Gesture.TAP) {

					// Intent Creation and Initialization
					Intent intent = new Intent(context2, CardScrollActivityOne.class);
//I have added the line: (flags) (for closing the first activity)
					intent.setFlags(Intent.FLAG_ACTIVITY_CLEAR_TOP);
					// Create a Bundle and Put Bundle into it (SENDS PERSON)
					Bundle bundleObject = new Bundle();
					bundleObject.putSerializable("key",ListOfPersons.get(imgIndex) );
					// Put Bundle into Intent and call start Activity
					intent.putExtras(bundleObject);
					startActivity(intent);
//I have added the line: (finish) (for closing the first activity)
					finish();
					return true;
					
				} else if (gesture == Gesture.TWO_TAP) {

					return true;
				} else if (gesture == Gesture.SWIPE_RIGHT) {
					// do something on right (forward) swipe
					imgIndex++;

					if (imgIndex < ListOfPersons.size()) {
						byte[] decodedString = Base64.decode(
								ListOfPersons.get(imgIndex).getPhotoRecPer(),
								Base64.DEFAULT);

						Bitmap decodedByte = BitmapFactory.decodeByteArray(
								decodedString, 0, decodedString.length);

						img.setImageBitmap(decodedByte);
					} else {
						imgIndex--;
					}
					return true;
				} else if (gesture == Gesture.SWIPE_LEFT) {
					// do something on left (backwards) swipe
					imgIndex--;

					if (imgIndex > -1) {
						byte[] decodedString = Base64.decode(
								ListOfPersons.get(imgIndex).getPhotoRecPer(),
								Base64.DEFAULT);

						Bitmap decodedByte = BitmapFactory.decodeByteArray(
								decodedString, 0, decodedString.length);

						img.setImageBitmap(decodedByte);
					} else {
						imgIndex++;
					}
					return true;
				}
				return false;
			}
		});
		gestureDetector.setFingerListener(new GestureDetector.FingerListener() {
			@Override
			public void onFingerCountChanged(int previousCount, int currentCount) {
				// do something on finger count changes
			}
		});
		gestureDetector.setScrollListener(new GestureDetector.ScrollListener() {
			@Override
			public boolean onScroll(float displacement, float delta,
					float velocity) {
				// do something on scrolling
				return true;
			}
		});
		return gestureDetector;
	}

